  //     })
  //     .then((res) => {
  //       console.log(res);
  //     });

  //   console.log(response);
  // },

  checkToken: async (token) => {
    const response = await fetch(`${baseURL}/auth/check`, {
      method: "GET",
      headers: {
        Authorization: token,
      },
    });
    const jsonData = await response.json();
    console.log(jsonData);
    return jsonData;
  },
};
